import numpy as np
from PIL import Image

length_side = 173

data = np.zeros((length_side, length_side, 3), dtype=np.uint8)

# https://www.ncbi.nlm.nih.gov/nuccore/MN908947.3
COVID19 = ""

COLORS = {"a": [0, 159, 215], "t": [0, 217, 157], "g": [104, 0, 213], "c": [252, 61, 85]}

current_base = 0
for x in range(length_side):
    for y in range(length_side):
        try:
            data[x:x+1, y:y+1] = COLORS[COVID19[current_base]]
        except IndexError:
            pass
        current_base += 1
img = Image.fromarray(data)

scaled_img = img.resize((length_side*8,length_side*8), 4)
scaled_img.save("img.png")